import logo from './logo.svg';
import './App.css';
import  Link  from 'react-router-dom';

class Navigation extends React.Component {



  render() {
    return (

     <ul>

        <li> <Link to="/">Home</Link>  </li>
        <li> <Link to="/signin">SignIn</Link>  </li>

     </ul>



     );
  }

}

export default Navigation;
